import React from 'react';

const Item = ({ product }) => {
  const { name, price } = product;
  const productExists = product && product._id;
  return productExists ? (
    <>
      <p>{product.name}</p>
      <p>{product.price}</p>
    </>
  ) : (
    <p>Empty</p>
  );
};

export default Item;
